import ReactDOM from "react-dom";

function Car2() {
  return <h2>Hi, I am also a Car!</h2>;
}

function shoot(){
  alert("Great shot!");
}

const myelement = (
  <button onClick={shoot}>Take the shot!</button>
)

ReactDOM.render(myelement, document.getElementById("root"));
